import React from "react";
import Layout from "../components/Layout";

const propTypes = {};

const defaultProps = {};

export default function index() {
  return (
    <Layout>
      <section className="flex vh-100 w-100">
        <aside className="title">Agenda</aside>
        <div className="grow w-100 flex col">
          <div className="grow">agenda item</div>
          <div className="grow tc">+ add item</div>
        </div>
      </section>
      <style jsx>
        {`
        .tc {
            text-align; center
        }
          h1 {
            font-family: Futura, "Trebuchet MS", Arial, sans-serif;
            font-size: 23px;
            font-style: normal;
            font-variant: normal;
            font-weight: 700;
            line-height: 23px;
          }
          h3 {
            font-family: Futura, "Trebuchet MS", Arial, sans-serif;
            font-size: 17px;
            font-style: normal;
            font-variant: normal;
            font-weight: 700;
            line-height: 23px;
          }
          p {
            font-family: Futura, "Trebuchet MS", Arial, sans-serif;
            font-size: 14px;
            font-style: normal;
            font-variant: normal;
            font-weight: 400;
            line-height: 23px;
          }
          blockquote {
            font-family: Futura, "Trebuchet MS", Arial, sans-serif;
            font-size: 17px;
            font-style: normal;
            font-variant: normal;
            font-weight: 400;
            line-height: 23px;
          }
          pre {
            font-family: Futura, "Trebuchet MS", Arial, sans-serif;
            font-size: 11px;
            font-style: normal;
            font-variant: normal;
            font-weight: 400;
            line-height: 23px;
          }
          .grow {
            flex-grow: 1;
          }

          .title {
            writing-mode: vertical-rl;
            transform: rotate(180deg);
            text-align: center;
            font-size: 4rem;
            text-transform: uppercase;
            padding: 0 20px;
          }
          .w-100 {
            width: 100%;
          }
          .dib {
            display: inline-block;
          }
          .vh-100 {
            height: 100vh;
          }

          .h-100 {
            height: 100%;
          }
          .bg-blue {
            background-color: blue;
          }
          .bg-red {
            background-color: red;
          }
          .col {
            flex-direction: column;
          }
          .flex {
            display: flex;
          }
          .grid {
            display: grid;
          }
        `}
      </style>
    </Layout>
  );
}

index.propTypes = propTypes;
index.defaultProps = defaultProps;
